/* eslint-disable no-unused-vars */
import React, { useState, useEffect } from 'react';
import TableRow from '@mui/material/TableRow';

import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import { Typography } from '@mui/material';
import ShippoRateFinales from './ShippoRateFinales';
import UseGetRateIntegradores from '../hooks/UseGetRateIntegradores';



const ShippoItem = ({datosfinales}) => {

	const shippo = UseGetRateIntegradores(datosfinales);
	const escondido = shippo.circulo;
	const shippofinal = shippo.data;
	console.log('SHIPPO:', shippofinal);

	return (
		<>
			<Grid item xs={12}>
				<Paper >
					<Typography variant="h5" component="h5">
					</Typography>{' '}
					<br />
					<TableContainer component={Paper}>
						<Table  size="small" aria-label="a dense table">
							<TableHead>
								<TableRow>
									<TableCell>Carrier</TableCell>
									<TableCell align="right">Currency</TableCell>
									<TableCell align="right">Rate</TableCell>
									<TableCell align="right">Service Level</TableCell>
									<TableCell align="right">Transit Time</TableCell>
									<TableCell align="right" />
								</TableRow>
							</TableHead>
							<TableBody>

							{ shippofinal.length > 0 ?
								shippofinal.map(datos => (
									<ShippoRateFinales key={datos} {...datos} />
								)) : null}
							</TableBody>
						</Table>
					</TableContainer>
				</Paper>
			</Grid>
			<br />
		</>
	);
};

export default ShippoItem;
